// Solution #1
// Time Complexity: O(n)
// Space Complexity: O(1)

class Solution {
public:
    int multiply(int A, int B) {
        if(A == 0 || B == 0)
            return 0;
        if(A == 1)
            return B;
        if(B == 1)
            return A;
        int sign = 1;
        if((A < 0 && B > 0) || (A > 0 && B < 0))
            sign = -1;
        A = abs(A);
        B = abs(B);
        int result = 0;
        while(B)
        {
            if(B & 1)
                result += A;
            A <<= 1;
            B >>= 1;
        }
        return sign * result;
    }
};

// Solution #2
// Time Complexity: O(n)
// Space Complexity: O(1)

class Solution {
public:
    int multiply(int A, int B) {
        if(A == 0 || B == 0)
            return 0;
        if(A == 1)
            return B;
        if(B == 1)
            return A;
        int sign = 1;
        if((A < 0 && B > 0) || (A > 0 && B < 0))
            sign = -1;
        A = abs(A);
        B = abs(B);
        int result = 0;
        while(B)
        {
            if(B & 1)
                result = add(result, A);
            A = add(A, A);
            B >>= 1;
        }
        return sign * result;
    }

    int add(int A, int B)
    {
        int carry = 0;
        int result = 0;
        int bit = 1;
        while(A || B || carry)
        {
            int sum = (A & 1) + (B & 1) + carry;
            carry = sum >> 1;
            result |= (sum & 1) * bit;
            bit <<= 1;
            A >>= 1;
            B >>= 1;
        }
        return result;
    }
};

