// Solution #1 - Recursive

function factorial(num) {
  if (num === 1) return num;
  return num * factorial(num - 1);
}

// Solution #2 - Iterative

function factorial(num) {
  let total = 1;
  for (let i = num; i > 1; i--) {
    total *= i;
  }
  return total;
}

// Solution #3 - Iterative

function factorial(num) {
  let total = num;
  while (num > 1) {
    num--;
    total *= num;
  }
  return total;
}
